export var SquareButtonVariant;

(function (SquareButtonVariant) {
  SquareButtonVariant["PRIMARY"] = "primary";
  SquareButtonVariant["DESTRUCTIVE"] = "destructive";
  SquareButtonVariant["INSTRUCTIVE"] = "instructive";
  SquareButtonVariant["WARNING"] = "warning";
  SquareButtonVariant["GHOST"] = "ghost";
  SquareButtonVariant["DARK_GHOST"] = "darkGhost";
  SquareButtonVariant["BLACK"] = "black";
  SquareButtonVariant["WHITE"] = "white";
  SquareButtonVariant["DEFAULT"] = "default";
})(SquareButtonVariant || (SquareButtonVariant = {}));
